INSERT INTO ITEM (id, rank, title) VALUES ( 1141, 2, 'The #1 Guitar Album', 2, 1, 'http://ecx.images-amazon.com/images/I/51S2u6IHXZL._SL75_.jpg', 'http://ecx.images-amazon.com/images/I/51S2u6IHXZL._SL160_.jpg', 5, 17.98, parsedatetime('2008-01-08', 'YYYY-MM-DD'), 1001, 1005, 'Next in the #1 series is this 2-CD set of masterful guitar performances, pieces by everyone from Brahms to the Beatles! The former ( Waltz, Op. 39, No. 15 , played by Pepe Romero) and the latter ( Yesterday , played by Goran Sollscher) join Prelude for Lute in C Minor Bach (played by Andres Segovia); Preludio in E Major Torroba (played by Julian Bream); Habanera from Carmen Bizet (played by Alexandre Lagoya), and more.');
