INSERT INTO ITEM (id, rank, title) VALUES ( 1160, 2, 'Barre Phillips', 1, 4, 'http://ecx.images-amazon.com/images/I/51VuNwALqLL._SL75_.jpg', 'http://ecx.images-amazon.com/images/I/51VuNwALqLL._SL160_.jpg', 7, 21.99, null, 1010, 1001, 'Mathematical theory : This equation : This trio : 1 is the individual - whose input is the basis of the work - which becomes 3, the trio. From there, 3, we move to 2, which is the audience plus the trio and then we move back to 1. This new 1 is the same individual but is no longer the same. (Barre Phillips) Legendary American bassist Barre Phillips, long a resident of France, teams with veteran European improvisers Urs Leimgruber (saxophones) and Jacques Demierre (piano) for this new and cleverly titled Jazzwerkstatt release.');
