INSERT INTO ITEM (id, rank, title) VALUES ( 1172, 2, 'Chris Daniels Kings', 1, 9, 'http://ecx.images-amazon.com/images/I/51YZDDPCHXL._SL75_.jpg', 'http://ecx.images-amazon.com/images/I/51YZDDPCHXL._SL160_.jpg', 5, 11.99, parsedatetime('2005-10-13', 'YYYY-MM-DD'), 1014, 1000, 'This is the CD that you put on at a party to make the place go nuts and wake the neighbors. It is the 10th recording for Chris and the Kings and it features the true blue horn-band sound that comes from sweet soul music somewhere between Memphis and new Orleans. The best horn band funk you ever heard in your life. Think Little Feat with horns, Tower of Power AWB with punch and you ogt 10.');
