INSERT INTO ITEM (id, rank, title) VALUES ( 1174, 3, 'Fop Form of Plasticity', 1, null, 'http://ecx.images-amazon.com/images/I/51IvHCHwidL._SL75_.jpg', 'http://ecx.images-amazon.com/images/I/51IvHCHwidL._SL160_.jpg', 2, 16.98, null, 1000, 1007, 'The name of the band makes it clear that also with their new CD release "10", as with their first two albums "Forms of Plasticity" (Extraplatte 2003) and "FipFop" (Universal 2004), Forms of Plasticity do not allow themselves to be categorised or pigeon-holed. It is simply a snapshot of a constantly developing sound. Virtuoso Jazz tones merge with electro-beat samples and TripHop elements; they change colour without completely losing their form and come together in melodic song-structures. The 10 new member states of the EU provide the basic concept and the inspirational source of this album. Each track is devoted to a country and holds a musical journey whose stages are made more fascinating by their wealth of colour and the virtuoso interaction of the musicians. Since their successful Mexico tour in summer 2005, the band - Johannes Specht on guitar, trumpet player Lorenz Raab (winner of Hans-Koller prize 2003, Lorenz Raab:xy band), Oliver Steger on bass (Café Drechsler, Drechsler/Steger/Tanschek Trio) and Mike Breneis on drums - has affiliated the turntable artist Felix Bergleitner, alias Bionic Kid (Waxolutionists) as a new member. Sandra Pires appears guest vocalist on track 3.');
