INSERT INTO ITEM (id, rank, title) VALUES ( 1183, 4, 'Ten compositions', 1, 2, 'http://ecx.images-amazon.com/images/I/617%2BSebCzkL._SL75_.jpg', 'http://ecx.images-amazon.com/images/I/617%2BSebCzkL._SL160_.jpg', 8, 20.99, null, 1009, 1000, 'A cult Montreal jazz band, Trio Derome Guilbeault Tanguay is loved for its irresistible swing, audacity, sophisticated group playing, highly original repertoire and authentic style. All these elements are the result of a vast comprehension of the history of jazz, not to mention a vigorous proposition as to its reinvention. With this first album, the Trio delivers ten new compositions by Jean Derome.');
